import React, { useState } from 'react';
import './CompanyRegistration.css';
import Header from '../components/Header';
import Footer from '../components/Footer';

function CompanyRegistration() {
  const [companyName, setCompanyName] = useState('');
  const [industry, setIndustry] = useState('');
  const [companySize, setCompanySize] = useState('');
  const [logo, setLogo] = useState(null);
  const [documents, setDocuments] = useState([]);

  const handleLogoUpload = (e) => {
    setLogo(e.target.files[0]);
  };

  const handleDocumentUpload = (e) => {
    setDocuments([...e.target.files]);
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    console.log({
      companyName,
      industry,
      companySize,
      logo,
      documents,
    });
  };

  return (
    <>
      <Header />
      <div className="reg-container">
        <form className="reg-form" onSubmit={handleSubmit}>
          <div className="form-header">
            <h2>Company Registration</h2>
            <p>Please provide your company details to create your account</p>
          </div>

          <label>Company Name *</label>
          <input
            type="text"
            value={companyName}
            onChange={(e) => setCompanyName(e.target.value)}
            placeholder="Enter your company name"
            required
          />

          <label>Industry *</label>
          <select
            value={industry}
            onChange={(e) => setIndustry(e.target.value)}
            required
          >
            <option value="">Select an industry</option>
            <option value="Tech">Technology</option>
            <option value="Education">Education</option>
            <option value="Finance">Finance</option>
            <option value="Healthcare">Healthcare</option>
          </select>

          <label>Company Size *</label>
          <div className="radio-container">
            <label>
              <input
                type="radio"
                value="small"
                checked={companySize === 'small'}
                onChange={() => setCompanySize('small')}
              />
              Less than 50 employees
            </label>
            <label>
              <input
                type="radio"
                value="medium"
                checked={companySize === 'medium'}
                onChange={() => setCompanySize('medium')}
              />
              50â€“100 employees
            </label>
            <label>
              <input
                type="radio"
                value="large"
                checked={companySize === 'large'}
                onChange={() => setCompanySize('large')}
              />
              More than 100 employees
            </label>
          </div>

          <div className="upload-section">
            <label>Company Logo *</label>
            <input
              type="file"
              accept="image/png, image/jpeg"
              onChange={handleLogoUpload}
              required
            />
            {logo && <p className="upload-info">{logo.name}</p>}

            <label>Verification Documents *</label>
            <input
              type="file"
              multiple
              accept=".pdf, .doc, .docx"
              onChange={handleDocumentUpload}
              required
            />
            {documents.length > 0 && (
              <ul className="upload-info">
                {documents.map((doc, index) => (
                  <li key={index}>{doc.name}</li>
                ))}
              </ul>
            )}
          </div>

          <button type="submit" className="submit-button">Submit</button>
        </form>
      </div>
    </>
  );
}

<Footer />

export default CompanyRegistration;
